def goDownTheSlope(colInt, rowInt):
	row = 0
	column = 0
	treesEncountered = 0

	for rowTry in puzzleInput:

		try:
			if puzzleInput[row][column] == "#":
				treesEncountered += 1
		except IndexError:
			break

		column += colInt
		if column > 29:
			column -= 31


		row += rowInt


	return treesEncountered


